import { LogoSvg } from "../components/LogoSvg";
import { motion } from "framer-motion";
import { Link } from "react-router-dom";

const visible = { opacity: 1, y: 0, transition: { duration: 1 } };

const itemVariants = {
  hidden: { opacity: 0, y: 0 },
  visible,
};

export default function Services() {
  return (
    <motion.article
      initial="hidden"
      animate="visible"
      exit={{ opacity: 0, transition: { duration: 1 } }}
    >
      <div className="flex justify-between items-center px-[46px] my-[2rem]">
        <Link to="/">
          <LogoSvg props={{}} />
        </Link>
        <ul className="flex gap-x-[40px] items-center">
          <motion.li
            className="the-nav-link font-medium cursor-pointer"
            variants={itemVariants}
          >
            <Link to="/">Our work</Link>
          </motion.li>
          <motion.li
            className="the-nav-link font-medium cursor-pointer"
            variants={itemVariants}
          >
            <Link to="/services">Services</Link>
          </motion.li>
          <motion.li
            className="the-nav-link font-medium cursor-pointer"
            variants={itemVariants}
          >
            <Link to="/faq">Faq</Link>
          </motion.li>
          <motion.li
            className="the-nav-link font-medium cursor-pointer"
            variants={itemVariants}
          >
            <Link to="/about-us">About us</Link>
          </motion.li>
        </ul>
      </div>
      <div className="flex justify-center items-center h-[55vh]">
        <motion.h1
          variants={{
            hidden: { opacity: 0, y: -20 },
            visible: { opacity: 1, y: 0, transition: { duration: 1 } },
          }}
          className="header-title"
        >
          Services
        </motion.h1>
      </div>
    </motion.article>
  );
}
